import Box from '@mui/material/Box';
export default function Profile(){
    return (
        <div>
            <Box id="profilePage">
                <Box id="profile-head">
                    profile edit
                </Box>
                <Box id="profile-setting">
                    Main Settings
                    <Box id="profile-name">Name</Box>
                    <Box id="profile-age">Age</Box>
                    <Box id="profile-gender">Gender</Box>
                    <Box id="profile-email">User Email</Box>
                    <Box id="profile-statement">My Statement</Box>
                </Box>
            </Box>
        </div>
    );
}
